import React, { useState } from "react";

const Deo = () => {
  const [count, setCount] = useState(0);
  const more = () => {
    return setCount(count + 1);
  };
  return (
    <>
      <h1>{count}</h1>
      <button onClick={more}>Increase Count</button>
    </>
  );
};

export default Deo;
